import { Button, Grid } from "@material-ui/core";
import { ValidatorForm, TextValidator } from "react-material-ui-form-validator";
import React, { useState } from "react";
import { useDispatch } from "react-redux";
import { register } from "actions/services/UserActions";
import { useEffect } from "react";
export default function RegisterPage(props) {
  const dispatch = useDispatch();

  const [fullName, setFullName] = useState("");
  const [phone, setPhone] = useState("");
  const [email, setEmail] = useState("");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [dateOfBirth, setDateOfBirth] = useState("");

  useEffect(() => {
    document.title = "Đăng ký tài khoản | Tiki";

    let isAuth = localStorage.getItem("token");
    if (isAuth && isAuth !== "undefined") {
      props.history.push("/");
    }
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();
    const data = {
      fullName,
      phone,
      email,
      username,
      password,
      dateOfBirth,
    };
    dispatch(register(data, props.history));
    // console.log(data);
  };

  return (
    <>
      <div
        className="row sm-gutter section__content"
        style={{ margin: "var(--header-height)" }}
      >
        <div className="col l-12 m-12 c-12">
          <div className="home-product">
            <div className="row sm-gutter section__item">
              <div className="col l-6 m-4 c-4">
                <div className="content-left">
                  <h2>Tạo tài khoản</h2>
                  <p>
                    Tạo tài khoản để theo dõi đơn hàng, lưu
                    <br /> danh sách sản phẩm yêu thích, nhận <br />
                    nhiều ưu đãi hấp dẫn.
                  </p>
                  <img
                    src="https://res.cloudinary.com/dk4pzxlqt/image/upload/v1688645837/Tutu1-removebg-preview_qqvmjl.png"
                    alt=""
                  />
                </div>
              </div>
              <div className="col l-6 m-8 c-8">
                <ValidatorForm onSubmit={handleSubmit}>
                  <Grid className="" container spacing={2}>
                    <Grid item sm={12} xs={12}>
                      <TextValidator
                        className="input-text"
                        type="text"
                        name="fullName"
                        value={fullName}
                        onChange={(e) => setFullName(e.target.value)}
                        label={
                          <span>
                            <span style={{ color: "red" }}>*</span>
                            Họ tên
                          </span>
                        }
                        validators={["required"]}
                        errorMessages={["Trường này không được để trống"]}
                      />
                    </Grid>
                    <Grid item sm={12} xs={12}>
                      <TextValidator
                        className="input-text"
                        // style={{ margin: '5px 0' }}
                        type="number"
                        name="phone"
                        value={phone}
                        onChange={(e) => setPhone(e.target.value)}
                        label={
                          <span>
                            <span style={{ color: "red" }}>*</span>
                            Số điện thoại
                          </span>
                        }
                        validators={["required"]}
                        errorMessages={["Trường này không được để trống"]}
                      />
                    </Grid>
                    <Grid item sm={12} xs={12}>
                      <TextValidator
                        className="input-text"
                        // style={{ margin: '5px 0' }}
                        type="text"
                        name="email"
                        value={email}
                        onChange={(e) => setEmail(e.target.value)}
                        label={
                          <span>
                            <span style={{ color: "red" }}>*</span>
                            Email
                          </span>
                        }
                        validators={["required"]}
                        errorMessages={["Trường này không được để trống"]}
                      />
                    </Grid>
                    <Grid item sm={12} xs={12}>
                      <TextValidator
                        className="input-text"
                        // style={{ margin: '5px 0' }}
                        type="text"
                        name="username"
                        value={username}
                        onChange={(e) => setUsername(e.target.value)}
                        label={
                          <span>
                            <span style={{ color: "red" }}>*</span>
                            Tên tài khoản
                          </span>
                        }
                        validators={["required"]}
                        errorMessages={["Trường này không được để trống"]}
                      />
                    </Grid>
                    <Grid item sm={12} xs={12}>
                      <TextValidator
                        className="input-text"
                        // style={{ margin: '5px 0' }}
                        type="password"
                        name="password"
                        value={password}
                        onChange={(e) => setPassword(e.target.value)}
                        label={
                          <span>
                            <span style={{ color: "red" }}>*</span>
                            Mật khẩu
                          </span>
                        }
                        validators={["required"]}
                        errorMessages={["Trường này không được để trống"]}
                      />
                    </Grid>
                    <Grid item sm={12} xs={12}>
                      <TextValidator
                        className="input-text"
                        style={{ margin: "5px 0" }}
                        type="date"
                        name="dateOfBirth"
                        value={dateOfBirth}
                        onChange={(e) => setDateOfBirth(e.target.value)}
                        placeholder=""
                        label={
                          <span>
                            <span style={{ color: "red" }}>*</span>
                            Ngày sinh
                          </span>
                        }
                        validators={["required"]}
                        errorMessages={["Ngày sinh không được để trống"]}
                      />
                    </Grid>
                    <Grid item sm={12} xs={12}>
                      <Button
                        variant="outlined"
                        color="secondary"
                        style={{ margin: "10px 0", width: "100%" }}
                        className="btn btn--e-transparent-brand-b-2"
                        type="submit"
                      >
                        Tạo tài khoản
                      </Button>
                    </Grid>
                  </Grid>
                </ValidatorForm>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
